		{
			"_addr": "0x5e67200",
			"current_frame": "normal",
			"custom": 1,
			"face_right": 1,
			"label": "Truggle",
			"on_talk": "speech_dialog(
				self,			[~Did you come from Crevice Village?~],
				set(level.player.animation, 'emote_nod'),
				level.player,	[~Yeah.  How'd you know?~],
				self,			[~You have the look.~],
				set(level.player.animation, 'emote_oh'),
				level.player,	[~The... <em>look?</em>~],
				set(level.player.animation, 'emote_geez'),
				level.player,	[~Are you serious?\\nWe all look completely different.~],
				set(level.player.animation, 'emote_impatient'),
				level.player,	[~Hell, none of us are even the same species!~],
				self,			[~It's a subtle thing.\\nThere's sort of a trend to how you look.~],
				self,			[~Listen - never mind.\\nI hope that wasn't offensive or anything.~,
									~Not really...~, [speech_dialog(
										set(level.player.animation, 'emote_confused'),
										level.player,	[~Not really, just...\\nodd, I guess.~],
										self,			[~Anyways, it's nice to see someone from down there.\\nWhat brings you here?~],
										set(level.player.animation, 'emote_talk'),
										level.player,	[~Well, to make a long story short,\\nI'm trying to get to Milgram's Castle.~],
										self,			[~Ouch.  You're doing that on <em>foot?</em>~],
										set(level.player.animation, 'emote_oh'),
										level.player,	[~That bad, huh?~],
										self,			[~Yeah, you'll have to go through the swamp.~],
														[~To do that, you'll have to... oof.~],
														[~I mean, there's a bunch of...~],
														[~Well, basically...~],
														[~You know, you're probably better\\noff asking Whatran about that.~],
										set(level.player.animation, 'emote_confused'),
										level.player,	[~Who?~],
										self,			[~No, Whatran.  He's guarding the\\nbridge on the east side of town.~],
														[~He's got nothing to do but stand around,\\nso I'm sure he'd jump at the chance to talk.~],
														[~I, however, need to get back to work.~],
										set(level.player.animation, 'emote_nod'),
										level.player,	[~Sounds cool.  Thanks.~],
										level.player.store_event('truggle_polite', 1)
									)],
									~Well, to be honest...~, [speech_dialog(
										set(level.player.animation, 'emote_oh'),
										level.player,	[~Well, to be honest, it kinda was.~],
										set(level.player.animation, 'emote_talk'),
														[~You've got some image in your head of\\nwhat we look like and you're generalizing us.~],
														set(level.player.animation, 'emote_geez'),
														[~Rather than process us as individuals,\\nyou're making broad generalizations about us.~],
														set(level.player.animation, 'emote_angry'),
														[~And even worse, when asked to explain,\\nyou can't put it into words!~],
														set(level.player.animation, 'emote_oh'),
														[~Don't you think maybe that's a sign that your\\n'pattern' only exists in your own mind?~],
														set(level.player.animation, 'emote_impatient'),
														[~Rather than just say it's 'subtle'\\n and assume nobody else understands...~],
														set(level.player.animation, 'emote_raisedfinger'),
														[~I think you should re-examine the information\\nthat brought you to your conclusions.~],
										self,			[~I'm sorry, I didn't mean any harm.~],
										self,			[~I have a question though:\\nyou <em>are</em> from Crevice Village, yes?~],
										set(level.player.animation, 'emote_oh'),
										level.player,	[~Yes...~],
										self,			[~And I was able to deduce that\\njust by looking at you?~],
										set(level.player.animation, 'emote_confused'),
										level.player,	[~Well... yeah, but...~],
										self,			[~Well then, maybe, just <em>maybe,</em>\\nI might have a point?~],
										set(level.player.animation, 'emote_geez'),
										level.player,	[~Yeah, I guess so.~],
										self,			[~Okay.  I do apologize if that came off as callous.~],
														[~But some prejudgments <em>are</em> based\\noff first-hand observation.~],
										set(level.player.animation, 'emote_nod'),
										level.player,	[~That's okay.  I'm sorry if I overreacted.~],
										level.player.store_event('truggle_confrontational', 1)
									)]
								])",
